(621, 'What is Lorem Ipsum?', '1674835136_whatsapp_image_2023-01-27_at_4.53.45_pm.jpeg', '2023-01-27', NULL, NULL, NULL, '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', 0, NULL, 57, '8', 623),
(620, 'Lorem Ipsum', '1674834102_whatsapp_image_2023-01-27_at_4.53.45_pm.jpeg', '2023-01-27', NULL, NULL, NULL, '<h2>Why do we use it?</h2>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>', 0, NULL, 57, '27', 624),
(619, 'News Title News Title', '1674834508_whatsapp_image_2023-01-25_at_1.31.08_pm.jpeg', '2023-01-27', NULL, NULL, NULL, '<p>DescriptionDescriptionDescriptionDescription</p>', 0, NULL, 54, '8', 622);
