INSERT INTO `tbl_destinations` (`id`, `short_title`, `title`, `description`, `image`, `banner_image`, `status`, `created_at`) VALUES
(8, 'Welcome to Srinagar, the summer capital of Jammu and Kashmir! Located in the beautiful Kashmir Valley, Srinagar is known for its serene lakes, colorful houseboats, and beautiful gardens.\r\n\r\nOne of the must-visit attractions in Srinagar is Dal Lake, which ', 'Discover the paradise on earth-Srinagar', 'For a glimpse of local culture, head to the Old City, where you can visit Jama Masjid, one of the largest mosques in India, and browse the bustling markets selling spices, jewelry, and handicrafts.\r\n\r\nSrinagar is also a great base for exploring the surrounding countryside, including the famous hill station of Gulmarg and the scenic Pahalgam Valley. With its stunning natural beauty and rich cultural heritage, Srinagar is a destination that you won\'t want to miss!', '1746041437_srinagar.webp', '1746041437_bg-hero.jpg', 1, '2025-04-30 19:30:37');
INSERT INTO `tbl_package` (`package_id`, `package_name`, `title`, `package_route_summary`, `package_description`, `package_image`, `package_status`, `is_special`, `created_at`) VALUES
(1, 'Kashmir Family Tour Package', 'Tempor erat elitr rebum at clita. Diam dolor diam ipsum sit diam amet diam eos', '[5D/4N] Srinagar » Pahalgam » Gulmarg', '<p><strong>DAY 01: ARRIVAL SRINAGAR AIRPORT</strong></p>\r\n\r\n<p>Welcome to Srinagar, the summer capital of Jammu and Kashmir! Upon arrival at the Srinagar International Airport, you will be greeted by our representative who will assist you with your luggage and transfer you to your hotel. Srinagar is a beautiful city located in the heart of the Kashmir Valley and is known for its scenic beauty, serene lakes, and Mughal gardens. After checking into your hotel, you can relax for a while and then head out to explore the city. In the evening, you can take a leisurely stroll around the famous Dal Lake, where you can take a shikara ride and enjoy the serene beauty of the lake and its surroundings. You can also visit the local markets and indulge in some shopping for traditional Kashmiri handicrafts, such as pashmina shawls, carpets, and handwoven fabrics. Enjoy a comfortable overnight stay at your hotel in Srinagar and get ready for an exciting day ahead.</p>\r\n\r\n<p><strong>DAY 02: SRINAGAR-PAHALGAM</strong></p>\r\n\r\n<p>Welcome to Srinagar, the summer capital of Jammu and Kashmir! Upon arrival at the Srinagar International Airport, you will be greeted by our representative who will assist you with your luggage and transfer you to your hotel. Srinagar is a beautiful city located in the heart of the Kashmir Valley and is known for its scenic beauty, serene lakes, and Mughal gardens. After checking into your hotel, you can relax for a while and then head out to explore the city. In the evening, you can take a leisurely stroll around the famous Dal Lake, where you can take a shikara ride and enjoy the serene beauty of the lake and its surroundings. You can also visit the local markets and indulge in some shopping for traditional Kashmiri handicrafts, such as pashmina shawls, carpets, and handwoven fabrics. Enjoy